import React from 'react';
import './App.css'
import Footer from '../src/components/footer/Footer';
import PostCard from './components/postCard/PostCard';
import postdata from './components/postCard/postdata';

const App = () => {
  return (
    <div className="app">
        {postdata.map((data, index) => (
        <PostCard
          key={index}
          username={data.username}
          date={data.date}
          text={data.text}
        />
      ))}
        <Footer/>
    </div>
  )
}

export default App;
